import { Grid } from '@material-ui/core';
import React from 'react';

import { sections } from '../../src/directory.data';

export const HomePage = () => {
  return (
    <Grid container justify='center'>
      {sections.map((sec) => (
        <Grid key={sec.id} item sm={4} style={{ backgroundColor: 'red' }}>
          {sec.title}
        </Grid>
      ))}
    </Grid>
  );
};
